import {Component, OnInit} from '@angular/core';
import {ConfirmationService, MessageService} from "primeng/api";
import {DialogService, DynamicDialogRef} from "primeng/dynamicdialog";
import {NegotiateComponent} from "../negotiate/negotiate.component";
import Swal from "sweetalert2";

@Component({
  selector: 'app-agreement-confirm',
  templateUrl: './agreement-confirm.component.html',
  styleUrl: './agreement-confirm.component.scss'
})
export class AgreementConfirmComponent implements OnInit{
  ref: DynamicDialogRef | undefined;

  constructor(private confirmationService: ConfirmationService, private messageService: MessageService, public dialogService: DialogService) {
  }

  agreementText: string | undefined;



  ngOnInit(): void {
   this.agreementText = "<p><img src=\"data:image/png;base64,\"></p>";
  }

  confirm(){
    console.log(this.agreementText);
    this.messageService.add({ severity: 'success', summary: 'Agreement Confirmed !', detail: '', life: 3000 });

  }

  confirmDelete(event: Event) {
    this.confirmationService.confirm({
      target: event.target as EventTarget,
      message: 'Do you want to reject this agreement?',
      icon: 'pi pi-info-circle',
      acceptButtonStyleClass: 'p-button-danger p-button-sm',
      accept: () => {
        this.messageService.add({ severity: 'error', summary: 'Rejected', detail: 'You have rejected', life: 3000 });
      }
    });
  }

  showNegotiate() {
    this.ref = this.dialogService.open(NegotiateComponent, { header: 'Agreement Confirmation', height: '62%', width: '70%'});
  }

}
